;; **
;;; Vemos que no podemos separar ninguna variable en funcin de sus valores para cada una de las categorias de la variable "Class"
;;; 
;;; Ahora, vamos a ver la relacin entre pares de variables
;; **

;; @@
(defn dibuja-scatter [caract1 caract2]
  (-> (core/with-data df
                      (charts/scatter-plot caract1 caract2 :group-by "Class"))
    (render/chart-view)))

(->> (rest variables-numericas)
  (map #(dibuja-scatter (first variables-numericas) %)))
