(defn no-hay-nil? [elt]
  (->> elt
    (filter #(not (nil? %)))
    (count)
    (= (count elt))
    ))

(def pca (->> (core/sel df :cols variables-numericas)
           (filter no-hay-nil?)
           (stats/covariance)
           (stats/principal-components)))
(def pca-valores (:std-dev pca))
(def pca-vectores (:rotation pca))
